import { defineStore } from "pinia";

export const useStore = defineStore("store", {
  state: () => ({
    city: "Selecione o destino",
    weight: "",
  }),
  actions: {
    submit() {
      console.log(this.city);
      console.log(this.weight);
    },
  },
});
